import React from 'react';
import styled from 'styled-components';

const FriendsListBlock = styled.div`
  width: 45%;
  max-height: 650px;
  border: 1px solid black;
  overflow-y: auto;
`;

const FriendsList = () => {
  return <FriendsListBlock></FriendsListBlock>;
};

export default FriendsList;
